export default function Embed (props) {
    return (
      <div className = "profile-section">
        <div className="section-title">{props.name}</div>
        <iframe src= {props.src} frameborder="0" width="600" height="300" allowfullscreen="true" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>
      </div>
    );
  }
